history.origin:

    Germany
, 13th century, second half, or 14th century, first half. The calendar's inclusion of saints like Willibald, bishop of Eichstätt, Rupert, bishop of Worms (and Salzburg), and the 300 Martyrs of Cologne seems to place the manuscript in Germany, and possibly its western part, or the surrounding area. Notable is the feast of 79 Martyrs on 21 February, which, according to Grotefend, is observed only in Cologne and Utrecht (
    Grotefend (1891)

), and, according to Beckman, in Cologne, Utrecht, and Worms (
    Beckman (1912)

). Here, it is erroneously designated as 89 martyrs (). Also notable is the fact that St Columbanus is included twice: both on October 24 and November 21. Both of these dates for the feast occur in Mainz and Worms (
    Grotefend (1891)

). The Maurine uirginis listed on March 10 is, presumably, the St Mariana (also Marina) who is associated with the St Agapa celebrated on the same day (see Ökumenisches Heiligenlexikon, March 10). A Maurine virginis is found on March 10 also in a calendar from Cologne found in Cambridge, University Library, MS Add. 3323 (
    Pink (2021)
). Notable is also the feast of St Serapion on November 14, in northern Europe observed, according to Grotefend, only in Utrecht (
    Grotefend (1891)

). St Euverte, otherwise observed mainly in France, is celebrated also in Utrecht, Liège and Worms. And finally, St Sigo (Sequanus), who is strongly associated with northern France, agreein in this with St Euverte and also sharing with him that they are venerated in Évora, Portugal, and by the French Cistercians.

note.p:
The two bifolia making up / and / respectively have been placed in the wrong order and should switch places. This appears to have happened already in the middle ages, as a contemporary hand seems to make a note on the incorrect order of the psalms at (sequitur dominus regnauit
). The hand adding the psalm numbers has also erased the 7 in its original 97 and changed this to a 9 - i.e. the Hebrew number for Dominus regnavit - erasing in the process part of the medieval note. The note on seems, however to pertain not to the order of the psalms but to the antiphons (Cantate domino canticum nouum Beatus homo quem tu erudieris
.)
